import React from 'react';
const Navigation = () => {
  return (
    <div className="navbar-nav-scroll">
      <ul className="navbar-nav">
        <li className="nav-item active text-uppercase text-white"><a className="nav-link" href="/">Documentation</a></li>
      </ul>
    </div>
  );
}
export default Navigation;
